using WA.Pizza.Core.Models;
using WA.Pizza.Infrastructure.Abstractions;

namespace WA.Pizza.Infrastructure.Data.Seed
{
    internal class CatalogItemSeeder : ISeeder
    {
        public async Task SeedAsync(AppDbContext dbContext)
        {
            var anyItems = dbContext.CatalogItems.Any();

            if (!anyItems)
            {
                var catalogItems = new List<CatalogItem>()
                {
                    new CatalogItem
                    {
                        Name = "Jumbo Pizza",
                        PictureBytes = "",
                        Price = 18.50m,
                        StorageQuantity = 210,
                    },
                    new CatalogItem
                    {
                        Name = "Easy Pizza",
                        PictureBytes = "",
                        Price = 13.50m,
                        StorageQuantity = 320,
                    },
                    new CatalogItem
                    {
                        Name = "Regular Beer",
                        PictureBytes = "",
                        Price = 2.70m,
                        StorageQuantity = 600,
                    },
                    new CatalogItem
                    {
                        Name = "Really Nice Beer",
                        PictureBytes = "",
                        Price = 3.30m,
                        StorageQuantity = 530,
                    },
                };

                await dbContext.CatalogItems.AddRangeAsync(catalogItems);
            }

        }
    }
}
